const Data = ({ data } : any) => {
    return (
    <>
        <th>{data.id}</th>
        <th>{data.owner}</th>
        <th>{data.content}</th>
        <th>{data.created_date}</th>
        <th>{data.important}</th>
    </>
    )
  }

  export default Data
